                if (_fsql.Select<Views>().Count() == 0 && data.Views != null && data.Views.Count > 0)
                {
                    _logger.LogInformation("初始化视图数据...");
                    _fsql.Insert(data.Views).ExecuteAffrows();
                }

            });
            return Task.CompletedTask;
        }

